    "Raptor observations associated with Terror Lake hydroelectric project: 1984 annual
    progress report",nt"tracking_summary": {ntt"total": 2,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:02:23.726530",nt"name": "raptor-observations-associated-with-terror-lake-hydroelectric-project-1984-annual-progress",nt"isopen":
    false,nt"url": null,nt"notes": "Raptors in the vicinity of the Terror Lake
    Hydroelectric Project (TLHP) were studied to determine the effects of project construction
    and operation on nesting and foraging behavior. Two raptor species, bald eagles
    (Haliaeetus leucocephalus) and rough-legged hawks (Buteo laqopus) nest within the
    project area and had the greatest potential for project impacts (AEIDC, 1980). Bald
    eagles prefer coastal and river valley habitats for nesting and foraging (survey
    sectors l and 2, Figure 2). Rough-legged hawks utilized interior cliffs and rocky
    outcrops adjacent to Terror Lake (survey sector 3, Figure 2) for nesting and generally
    foraged for tundra voles in the sparsely vegetated alpine areas. Steenhof (1978)
    provided a literature review of effects of human disturbance to bald eagles. Duffy
    and Ellison (1979) also identified effects on human disturbance on other breeding
    birds. The most evident effects of TLHP construction disturbance on raptors has
    been in survey sectors l and 3. Both of these areas were exposed to direct construction
    disturbance. Project effects on raptors on the lower Terror River and Bay area (survey
    sector 2) are indirect as no construction activity occurred in this area.",nt"license_title":
